form .checkbox {
  display: inline-flex;
  cursor: pointer;
  position: relative;
}
form .checkbox input {
  height: 16px;
  width: 16px;
  position: absolute;
  -webkit-appearance: none;
  -moz-appearance: none;
  -o-appearance: none;
  appearance: none;
  border: 1px solid #b3b1b7;
  border-top: 2px solid #b3b1b7;
  border-right: 2px solid #b3b1b7;
  outline: none;
  transition-duration: 0.3s;
  background-color: #ffffff;
  cursor: pointer;
}
form .checkbox input:checked {
  border: none;
  background-color: #ff8149;
}
form .checkbox input:checked + span::before {
  content: "✓";
  display: block;
  text-align: center;
  color: #ffffff;
  position: absolute;
  left: -0.8em;
  top: 0.6em;
}
form .radio-item input[type=radio] {
  position: absolute;
  opacity: 0;
  right: 10px;
}
form .radio-item input[type=radio] + .selection:before {
  content: "";
  background: #ffffff;
  border-radius: 100%;
  border: 1px solid #b3b1b7;
  display: inline-block;
  position: relative;
  margin-right: 1em;
  vertical-align: top;
  cursor: pointer;
  text-align: center;
  transition: all 250ms ease;
}
form .radio-item input[type=radio]:checked + .selection:before {
  background-color: #ff8149;
  box-shadow: inset 0 0 0 3px #ffffff;
  border: 1px solid #ff8149;
}
form .radio-item input[type=radio]:focus + .selection:before {
  outline: none;
  border: 1px solid #ff8149;
}
form .radio-item input[type=radio]:disabled + .selection:before {
  background-color: #ff8149;
  box-shadow: inset 0 0 0 3px #ffffff;
}
form .radio-item input[type=radio] + .selection:empty:before {
  margin-right: 0;
}

