sources.styles/02-base/_typo.scss:
// typo

// * headings

h1 {
  @include font(inter, medium);
  font-size: clamp($font-44, $font-56, $font-64);
  line-height: clamp(0, 76px, 87px);
  letter-spacing: 3px;
}

h2 {
  @include font(inter, medium);
}

h3 {
  @include font(manrope, semibold);
  font-size: $font-32;
}

h4 {
  @include font(inter, regular);
  font-size: $font-24;
  font-weight: $medium;
}

//  font-families, font-size, font-weight / components, layout, pages

// * components

//  cards
.card {
  &__company-name {
    @include font(inter, medium);
    font-size: $font-14;
  }

  &__text {
    @include font(inter, regular);
    font-size: $font-14;
    line-height: $font-24;
  }

  &__header {
    @include font(inter, medium);
    line-height: 34px;
    letter-spacing: 0.2px;
  }

  &__description {
    @include font(inter, regular);
    font-size: $font-14;
    letter-spacing: 0.1px;
  }

  &__descriptor {
    @include font(manrope, semibold);
    font-size: $font-14;
    font-weight: $light;
