// buttons

.btn_def {
  display: block;
  border: none;
  text-align: center;
  white-space: nowrap;
  text-decoration: none;
  @include transition(background-color 0.3s ease-in-out);

  &:hover {
    @include transition(background-color 0.3s ease-in-out);
  }

  // navigation
  &--nav {
    padding: 10px 22px 11px 19px;
    background-color: $color-white;

    &:hover {
      color: $color-haiti;
      text-decoration: none;
    }
  }

  // homepage-search-box
  &--search-box {
    background-color: $color-coral;
    color: $color-white;

    &:hover {
      color: $color-white;
      background-color: $color-blazeorange;
    }

    &-sm,
    &-xs {
      &:hover {
        color: $color-white;
        background-color: $color-blazeorange;
      }
    }
  }

  // homepage-find-job
  &--find-jobs-now {
    padding: 24px 45px 21px 44px;
    color: $color-white;
    background-color: $color-coral;
    img {
      padding-right: 11px;
      font-size: 20px;
      color: $color-white;
    }

    &:hover {
      color: $color-white;
      background-color: $color-blazeorange;
      text-decoration: none;
    }
  }

  // company-vacancies
  &--search-box-xs {
    background-color: $color-coral;
    color: $color-white;
  }

  // search-jobsOne/searchJobsTwo-searchbox
  &--search-box-sm {
    padding: 15px 39px;
    background-color: $color-coral;
    color: $color-white;
  }

  // homepage-trending
  &--trending {
    display: inline-block;
    white-space: normal;
    padding: 7px 15px 8px 15px;
    background-color: $color-white;
    color: $color-midgray;
    opacity: 0.7;
  }

  // searchjobsTwo-location
  &--location {
    display: inline-block;
    background-color: $color-coral;
    color: $color-white;
    &:hover {
      color: $color-white;
      background-color: $color-blazeorange;
    }
  }

  // company-reviews-cards
  &--helpful {
    display: inline-block;
    background-color: transparent;
    color: $color-coral;
    border: 1px solid $color-coral;
    &:hover {
      color: $color-blazeorange;
    }
  }

  // company-reviews-cards

  &--recommendation-green {
    color: $color-chateaugreen;
    background-color: rgba(57, 177, 99, 0.1);
  }

  &--recommendation-red {
    color: $color-bittersweet;
    background-color: rgba(255, 97, 97, 0.1);
  }

  &--recommendation-gray {
    color: $color-midgray;
    background-color: $color-athensgray;
  }

  // pricing-price
  &--pricing {
    background-color: $color-coral;
    color: $color-white;

    &:hover {
      background-color: $color-blazeorange;
      color: $color-white;
    }
  }

  &--pricing-gray {
    background-color: $color-athensgray;
    color: $color-midgray;
    border: 1px solid $color-bonjour;

    &:hover {
      background-color: $color-bonjour;
      color: $color-midgray;
    }
  }

  // company-right-block
  &--share {
    display: inline-block;
    color: $color-midgray;
    background-color: $color-white;

    i {
      font-size: 17px;
      padding-right: 7px;
    }

    &:hover {
      color: $color-midgray;
    }
  }

  &--review {
    display: inline-block;
    color: $color-white;
    background-color: $color-coral;
    &:hover {
      color: $color-white;
      background-color: $color-blazeorange;
    }
  }
}

// dropdown-button
.btn {
  color: $color-shipgray;

  &:focus,
  &:after {
    outline: none !important;
    box-shadow: none;
  }
}

.dropdown-toggle {
  text-decoration: underline;
}

.dropdown-item {
  padding: 0;
}

.dropdown-menu.show {
  display: flex;
  flex-direction: column;

  li {
    display: flex;
  }

  .option {
    margin-left: 6px;
    img {
      width: 11px;
      height: 11px;
      margin-top: 4px;
    }
    a {
      padding: 0 10px;
    }
  }
}

