      .card__recommendation {
        display: flex;
        padding: 0 0 0 60px;

        .btn_def {
          margin-top: 8px;
          padding-right: 12px;

          i {
            padding: 0 4px;
          }
        }
      }

      // three recommendation buttons placement
      .three-badge {
        padding: 0 0 0 62px;

        div:last-child {
          grid-column-start: 1;
          grid-column-end: 1;
          width: 29%;
        }
      }

      .card__body {
        padding: 1px 23px 14px 62px;

        .card__comment {
          padding-bottom: 8px;
        }

        .card__text {
          margin: 0;
        }
      }

      .card__bottom {
        display: flex;
        padding: 0 0 0 53px;

        .share {
          margin: auto 0 auto auto;
          padding: 0 20px 0 0;

          span {
            display: flex;
            align-items: center;

            i {
              padding: 0 0 0 8px;
            }
          }
