      padding: 0 0 0 14px;
      &__top {
        header {
          padding-bottom: 4px;
        }

        p {
          padding: 0 0 13px 24px;
        }
      }

      p {
        margin: 0 0 24px 0;
      }
    }

    &--pricing {
      .pricing__prices {
        .pricing__texts {
          padding-bottom: 6px;
        }
      }

      .pricing__options {
        .pricing__option {
          &:first-child {
            padding: 36px 0 56px 0;
          }

          &:not(:first-child) {
            padding: 13px 0 16px 0;
            border: none;
          }

          img {
            margin-top: -5px;
            margin-bottom: -15px;
          }

          // below selectors are horizontal borders between pricing-option-items for lg and xl breakpoints. I used this method because margins between cards were causing spacing trouble on big resolution
          &:after {
            content: "";
            position: absolute;
            left: -40px;
            bottom: 251px;
            width: 245px;
            height: 1px;
            background-color: $color-bonjour;
            opacity: 0.5;
          }

          &:first-child:after {
            bottom: 197px;
          }

          &:nth-child(2):after {
            bottom: 144px;
          }

          &:nth-child(3):after {
            bottom: 89px;
          }
        }
      }
    }
  }

  // bigger-card (spotify)
  .bigger-card {
    min-height: 408px;
  }
}

// X-Large devices (large desktops, 1200px and up)

@media (min-width: 1200px) {
  .card {
    &--clients {
      padding: 44px 36px;
    }

    &--srjTwo {
      .card__bottom {
        padding-bottom: 32px;
        article > .card__descriptor {
          padding: 22px 0 16px 0;
        }

        .card__text {
          padding: 0 40px 12px 0;
        }

        .card__video-lg {
          padding: 2px 36px 0 0;
          float: right;
        }
      }
    }

    &--pricing {
      .pricing__prices {
        .pricing__texts {
          padding-bottom: 15px;
        }
      }

      // this component is visible only on xl and contains only text. i used the pricing-card but hide the topper elements to get same alignment with the other cards
      &--only-text {
        text-align: left;
        white-space: nowrap;
        z-index: 1;

        .pricing__prices,
        .pricing__button {
          visibility: hidden;
        }

        .pricing__text {
          white-space: normal;
          padding: 2px 40px 0 0;
          line-height: -0.05;
        }

        .pricing__options {
          padding-top: 15px;
        }

        .pricing__option {
          color: $color-shipgray;

          &:after {
            content: "";
            position: absolute;
            left: 0px;
            bottom: 259px;
            width: 228px;
            height: 1px;
            opacity: 0.5;
          }

          &:first-child:after {
            bottom: 205px;
          }

          &:nth-child(2):after {
            bottom: 154px;
          }

          &:nth-child(3):after {
            bottom: 99px;
          }
        }

        // JOB BOARD
        .pricing__options:before {
          content: "job board";
          position: absolute;
          top: 298px;
          left: 0;
        }

        // MANAGED RECRUITING
        .pricing__options:after {
          content: "managed recruiting";
          position: absolute;
          bottom: 315px;
          left: 0;
        }
      }
    }
  }
}

// XX-Large devices (larger desktops, 1400px and up)

@media (min-width: 1400px) {
}

sources.styles/03-components/_search-bar.scss:
// search-bar

.search-box {
  display: flex;
  background-color: $color-white;
  &__top {
    &__btn {
      color: $color-shipgray;
      text-transform: uppercase;
      text-decoration: none !important;
      @include transition(all 0.3s ease-in-out);

      &:link {
        color: $color-shipgray;
        background-color: $color-white;
      }
      &:visited {
        color: $color-shipgray;
        background-color: $color-white;
      }
      &:hover {
        color: $color-shipgray;
      }
      &:focus {
        color: $color-shipgray;
        background-color: $color-dustygray;
      }
      &:active {
        background-color: $color-dustygray;
      }
    }

    &__btn:first-child {
      padding: 6px 52px 11px 18px;
    }
    &__btn:last-child {
      padding: 6px 18px 11px 17px;
      margin-left: -4px;
    }

    &--lg {
      .search-box__top__btn:link {
        background-color: $color-white;
      }
      .search-box__top__btn:visited {
        background-color: $color-white;
      }
    }
  }

  &__searchInput {
    display: flex;
    width: 100%;
    .input {
      display: flex;
      flex-direction: column;
      justify-content: center;
      width: 100%;
      padding: 11px 24px;

      i {
        font-size: $font-24;
        background-color: $color-white;
        color: $color-spunpearl;
        padding: 20px 12px 0 0;
      }
      .input-search {
        width: 100%;
        outline: none;
        border: none;
      }
      .input-search::-webkit-input-placeholder {
        color: $color-midgray;
        letter-spacing: 0.1px;
      }
    }
    .search-btn {
      margin: auto;
    }

    .left,
    .right {
      .wrapper {
        height: 100%;
        display: flex;
      }
    }
    .left {
      position: relative;
    }
    // border-divider
    .left:after {
      content: "";
      position: absolute;
      height: 60px;
      width: 1px;
      background-color: $color-bonjour;
    }
  }
}

.showing {
  color: $color-mountainmist;
}

.sort-by {
  color: $color-mountainmist;
}

.filter {
  color: $color-mountainmist;
}

// * responsive

// Extra Small devices (phone, 320px and up)

@media (min-width: 320px) and (max-width: 576px) {
  .search-box {
    margin: 0 10px;
    @include box-shadow(0px 10px 40px -15px rgba(0, 0, 0, 0.3));

    &__top {
      margin: 10px 0 10px 10px;
    }
    &__searchInput {
      display: flex;
      flex-direction: column;
      padding: 10px 10px 0 14px;
      .input {
        i {
          font-size: 20px;
        }
      }
      .left,
      .right {
        padding: 0;

        .wrapper {
          height: 100%;
          display: flex;
          padding: 4px;
        }
        .wrapper > i {
          padding: 14px 18px 0 0;
        }

        .input-search {
          outline: none;
          border: none;
          padding: 14px 0;
        }
      }
      .left:after {
        height: 1px;
        width: 91%;
        bottom: 0;
        left: 10px;
      }
    }
  }
  // search-box top ve search-box placement
  .homepage__search-box {
    margin: 290px 0;
  }

  .company {
    // vacancies-search-box
    &__search-box {
      .search-box {
        box-shadow: none;
        margin: 0;

        &__searchInput {
          padding: 0 15px;
        }

        .wrapper {
          padding: 0;
          border: 1px solid $color-bonjour;
          i {
            font-size: 15px;
            padding: 11px 9px;
          }

          .input-search {
            padding: 10px 0 0 0;
          }
        }
      }

      // I reused the same component from search-employeers page
      .search-employeers__result__top {
        text-align: center;

        .filter__header {
          padding-top: 10px;
        }
      }
    }

    &__reviews__search {
      .search-box {
        margin: 0;
        padding-top: 20px;
        box-shadow: none;

        &__searchInput {
          padding: 0;

          .input {
            display: flex;
            flex-direction: row;
            justify-content: flex-start;
            padding: 0;
            border: 1px solid $color-bonjour;

            input {
              border: none;
            }

            .search {
              padding-top: 9px;
            }

            .oval-search {
              padding: 9px 11px;
              font-size: 16px;
            }
          }
        }
      }
    }
  }
}

// Small devices (phone, 577px and up)

@media (min-width: 577px) and (max-width: 767px) {
  .search-box {
    &__top {
      margin-bottom: 9px;
    }
    &__searchInput {
      display: flex;
      flex-direction: column;
      padding: 0 10px 0 10px;
      margin-bottom: 10px;
      justify-content: center;
      .input {
        .input-search {
          outline: none;
          border: none;
          padding: 12px 0;
        }
        .wrapper > i {
          padding: 14px 18px 0 0;
        }
      }
      .left:after {
        height: 1px;
        width: 500px;
        top: 75px;
        left: 10px;
      }
    }
  }

  // search-box top ve search-box placement
  .homepage__search-box {
    margin: 120px 0;
  }

  .company {
    // vacancies-search-box
    &__search-box {
      .search-box {
        box-shadow: none;
        margin: 0;

        &__searchInput {
          padding: 0 15px;

          .input {
            padding: 0;
          }
        }

        .wrapper {
          padding: 0;
          border: 1px solid $color-bonjour;
          i {
            font-size: 15px;
            padding: 11px 9px;
          }

          .input-search {
            padding: 0;
          }
        }
      }

      // I reused the same component from search-employeers page
      .search-employeers__result__top {
        text-align: center;

        .showing {
          padding-right: 22px;
        }
        .filter__header {
          padding-top: 10px;
        }
      }
    }

    &__reviews__search {
      .search-box {
        margin: 0;
        padding-top: 20px;
        box-shadow: none;

        &__searchInput {
          padding: 0;

          .input {
            display: flex;
            flex-direction: row;
            justify-content: flex-start;
            padding: 0;
            border: 1px solid $color-bonjour;

            input {
              border: none;
            }

            .oval-search {
              padding: 9px 11px;
              font-size: 16px;
            }
          }
        }
      }
    }
  }
}

// Medium devices (tablets, 768px and up)

@media (min-width: 768px) {
  .search-box {
    @include box-shadow(0px 10px 40px -15px rgba(0, 0, 0, 0.3));

    &__top {
      margin-bottom: 9px;
    }

    &__searchInput {
      .input {
        .input-search {
          padding: 16px 0;
        }
      }
      .left:after {
        right: -8px;
        top: 8px;
      }
      .right {
        padding-left: 40px;
      }
    }
  }
  // search-box top ve search-box placement
  .homepage__search-box {
    margin: 428px 0;
  }

  .company {
    // vacancies-search-box
    &__search-box {
      .search-box {
        box-shadow: none;

        .input {
          padding: 0;

          .wrapper {
            display: flex;
            align-items: center;
            padding: 6px 9px;

            .input-search,
            .oval-location,
            .oval-search {
              padding: 0;
            }

            label {
              margin: 0;
            }
          }
        }

        .left .wrapper {
          border: 1px solid rgba($color-bonjour, 0.5);
          border-right: none;
        }

        .right .wrapper {
          border: 1px solid rgba($color-bonjour, 0.5);
          border-right: none;
        }

        .oval-search,
        .oval-location {
          font-size: 14px;
          margin-right: 9px;
        }
      }

      // I reused the same component from search-employeers page
      .search-employeers__result__top {
        padding: 0 0 20px 0;
        margin: 20px 0 0 0;
        .btn-group-top {
          display: flex;
          justify-content: space-between;
        }
        .filter__header {
          padding: 0 0 0 14px;
        }

        button {
          padding: 0 11px 0 4px;
        }
      }
    }

    &__reviews__search {
      .search-box {
        padding: 0;
        margin: 10px 0;
        &__searchInput {
          padding: 0;
          justify-content: flex-end;

          .input {
            display: flex;
            flex-direction: row;
            justify-content: flex-start;
            padding: 0;
            border: 1px solid $color-bonjour;
            width: 62%;

            label {
              padding: 0;
              margin: 4px 0 0 0;
              input {
                border: none;
              }
            }

            .oval-search {
              padding: 9px 11px;
              font-size: 16px;
            }
          }
        }
      }
    }
  }
}

// Large devices (desktops, 992px and up)

@media (min-width: 992px) {
  .search-box {
    height: 86px;
    @include box-shadow(0 60px 75px -4px rgba(0, 0, 0, 0.1));

    &__top {
      margin-bottom: 10px;
    }
    &__searchInput {
      .input {
        .input-search {
          padding: 20px 0;
        }
      }
      .left:after {
        right: -10px;
        top: 14px;
      }
      .right {
        padding-left: 40px;
      }
    }

    &--lg {
      height: 80px !important;
      .search-box__searchInput {
        .input {
          padding: 8px 50px;
        }
        .left {
          padding-left: 26px;
        }

        // border-divider
        .left:after {
          height: 56px;
          right: -27px;
          top: 12px;
        }
      }
    }
  }
  // search-box top ve search-box placement
  .homepage__search-box {
    margin: 38px 0;
  }

  .company {
    // vacancies-search-box
    &__search-box {
      .search-box {
        height: auto;
        .input {
          .wrapper {
            // display: flex;
            // align-items: center;
            padding: 3px 0 4px 8px;

            .input-search,
            .oval-location,
            .oval-search {
            }

            ::placeholder {
              color: $color-spunpearl;
            }
          }
        }

        .oval-search,
        .oval-location {
          font-size: 16px;
          margin-right: 9px;
        }
      }

      .search-employeers__result__top {
