      }

      .search-employeers__result__top {
        padding: 17px 0 17px 0;

        .btn-group {
          margin-top: -2px;
        }

        .btn-group-top {
          text-align: left;
        }

        .filter__header {
          padding: 0 4px 0 30px;
        }
      }
    }

    &__benefits {
      margin: 30px 5px 47px 5px;
      padding: 15px 17px 0 30px;
    }
  }
}

// Large devices (desktops, 992px and up)

@media (min-width: 992px) {
  .navbar {
    &--company {
      position: absolute;
      top: 0;
      width: 100%;
      margin-bottom: 24px;
    }
  }

  .company {
    background: no-repeat url("../assets/img/company-dummy-lg.png") 52.2% 2.9%;
    padding-top: 157px;

    &__buttons {
      padding: 26px 0 0 5px;
      margin-left: -6px;

      .btn_def--review {
        margin: 0 0 0 -5px;
      }
    }

    &__vacancies {
      padding: 20px 32px 20px 30px;
      margin: -38px 0 32px 0;

      .card__descriptor {
        padding: 0 0 32px 0;
      }

      .card--boards:first-child {
        margin-top: 16px;
      }
    }

    &__right {
      margin-left: 30px;
      width: 95%;
    }

    &__culture {
      margin: 56px 0 32px 0;
      padding: 20px 24px 24px 22px;

      header,
      p,
      a,
      &__video {
        padding: 0;
        margin: 0;
      }

      p {
        padding: 14px 0 5px 0;
      }

      a {
        display: flex;
        justify-content: flex-end;
        padding-bottom: 5px;
      }

      &__video {
        height: 190px;
        iframe {
          height: 100%;
        }
      }
    }

    &__contact {
      padding: 20px 24px 21px 24px;

      &__social-icons {
        padding: 11px 11px 12px 0;
      }
    }

    &__reviews {
      padding: 29px 32px 8px 32px;

      &__top {
        padding: 0 0 12px 0;

        .card__time {
          padding-top: 7px;
        }
      }

      &__body {
        padding: 10px 0;
      }

      &__search {
        width: 72%;
        .search-box__searchInput {
          .input {
            width: 64.6%;
          }
        }
      }

      &__ratings__right {
        padding: 5px 0 0 7px;
        .review {
          padding: 0 0 0 2px;
        }
      }

      .search-employeers__result__top {
        margin-top: 18px;

        .btn-group-top {
          .filter__header {
            padding: 5px 6px 4px 28px;
            margin-left: auto;
          }
        }
      }

      &__cards {
        padding: 21px 32px;
      }
    }

    &__benefits {
      margin: 32px 0 82px 0;
      padding: 0;

      &__top {
        padding: 30px 32px 0 32px;

        header {
          padding-bottom: 10px;
        }

        p {
          padding-bottom: 8px;
        }
      }

      &__cards {
        padding: 18px 32px 32px 32px;
      }
    }
  }
}

// X-Large devices (large desktops, 1200px and up)

@media (min-width: 1200px) {
  .company {
    background: no-repeat url("../assets/img/company-dummy-lg.png") 52.5% 2.9%;
  }
}

// XX-Large devices (larger desktops, 1400px and up)

@media (min-width: 1400px) {
  .company {
    background: no-repeat url("../assets/img/company-dummy-lg.png") 50.32% 2.9%;
  }
}

@media (min-width: 2000px) {
  .company {
    background: no-repeat url("../assets/img/company-dummy-lg.png") 50.22% 2.9%;
  }
}

sources.styles/05-pages/_pricing.scss:
// pricing

.navbar {
  &__menu-left > a,
  &__menu-right > a {
    color: $color-shipgray;
  }
}

.pricing {
  &__heading__text {
    color: $color-midgray;
  }

  &__plans__form {
    border: 1px solid $color-bonjour;
    background-color: $color-athensgray;

    .selection {
      color: $color-shipgray;
    }

    span {
      color: $color-coral;
    }
  }

  &__background {
    background: url("../../oval-finder/assets/img/pricing-header-dummy.png")
      no-repeat;
    margin: 0 auto;
  }

  &__text {
    color: $color-mountainmist;
  }

  &__options:before,
  &__options:after {
    color: $color-spunpearl;
  }

  &__stacks__text {
    color: $color-shipgray;
  }

  &__old-price {
    color: $color-spunpearl;
    text-decoration: line-through;
  }

  &__traits__option {
    color: $color-spunpearl;
  }

  &__traits__option--marked {
    color: $color-shipgray;
  }

  .oval-check-filled {
    color: $color-carbbeangreen;
  }

  &__button {
    a {
      text-decoration: none;
    }
  }
}

// * responsive

// Extra Small devices (phone, 320px and up)

@media (min-width: 320px) {
  .pricing {
    &__heading {
      padding: 6px 20px 0 20px;
      text-align: center;

      &__header {
        padding-bottom: 9px;
      }

      &__text {
        padding-bottom: 19px;
      }
    }

    &__background {
      width: 100%;
      height: 240px;
      margin: 0 20px;
    }

    &__plans {
      width: 100%;

      header h2 {
        padding: 28px 0 5px 0;
        text-align: center;
      }

      &__form {
        margin: 50px 4px; // !fix it
      }
    }

    &__payment {
      padding: 0 5px;

      .pricing__button {
        margin-top: 22px;
        display: flex;
        justify-content: center;
      }
    }
  }
}

// Small devices (phone, 577px and up)

@media (min-width: 577px) {
  .pricing {
    padding: 0;
  }
}

// Medium devices (tablets, 768px and up)

@media (min-width: 768px) {
  .pricing {
    margin-bottom: 90px;
    &__heading {
      text-align: center;

      &__header {
        padding: 10px 100px 6px 100px;
      }
      &__text {
        padding: 0 100px 24px 100px;
      }
    }

    &__background {
      width: 100%;
      height: 260px;
      margin: 16px 6px 0 6px;
    }

    &__plans {
      header h2 {
        padding: 35px 120px 16px 120px;
        text-align: center;
      }

      &__form {
        margin: 0 86px;
      }
    }

    &__payment {
      padding: 0 3px;
    }
  }
}

// Large devices (desktops, 992px and up)

@media (min-width: 992px) {
  .pricing {
    margin-bottom: 90px;

    &__heading {
      margin: 166px 0 46px 0;
      text-align: left;

      &__header {
        padding: 4px 90px 0 84px;
      }

      &__text {
        padding: 20px 100px 3px 20px;
      }
    }

    &__background {
      width: 1140px;
      height: 450px;
    }

    &__plans {
      margin: 75px 0 0 0;

      header h2 {
        padding: 35px 120px 34px 120px;
      }

      &__form {
        margin: 0 20.5% 60px 20.5%;
      }
    }

    &__stacks {
      padding: 135px 0 0 0;
    }

    &__payment {
      padding: 0 11px 0 0;

      .pricing__button {
        margin-top: 32px;
      }
    }
  }
}

// X-Large devices (large desktops, 1200px and up)

@media (min-width: 1200px) {
  .pricing {
    margin-bottom: 278px;

    &__plans {
      header h2 {
        padding: 35px 220px 34px 220px;
      }

      &__form {
        margin: 0 24.9% 60px 24.9%;
      }
    }
  }
}

// XX-Large devices (larger desktops, 1400px and up)

@media (min-width: 1400px) {
}
